  \"2016-07-07T00:52:37.381940\",\n\t\"name\": \"existing-and-candidate-state-park-and-ride-locations\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset presents existing and candidate
  park and ride lots in the state of Iowa, represented in a point feature.  Point
  features were created using aerial imagery.rnrnThe Iowa Department of Transportationu2019s
  park and ride system consists of state-owned park and ride lots. Many of these lots
  were developed during the 1980s, primarily in response to a growing demand that
  resulted from an increase in fuel prices. In most cases, lot development was truly
  the result of grassroots efforts, with Iowa DOTu2019s district offices often responding
  to specific public requests for park and ride facilities.rnrnAs a part of the plan
  this database was created to geographically reference both existing state-owned
  park and ride facilities and ideal candidates for future expansion of the system.
  This database will also be used in coordination with the statewide rideshare program,
  so it will also include other existing park and ride facilities not owned by the
  state or identified in the plan. Ultimately this inventory has two main purposes
  that can be described generally as internal and external. Internally, the database
  will be used to keep track of state-owned inventory and identify opportunities for
  the expansion of the state-owned and operated park and ride system. Externally,
  the database will be expanded to include a wide array of park and ride facilities
  across the state of Iowa that can be disseminated to the public via the Iowa DOT
  website and coordinated with the rideshare program.\",\n\t\"license_title\": \"License
